ConstValues.value:
"query TotalContribution($login: String!) {
  user(login: $login) {
    __typename
    contributionsCollection {
      __typename
      contributionCalendar {
        __typename
        totalContributions
      }
    }
  }
}"

"query GithubUser($login: String!, $from: DateTime!, $to: DateTime!) {
  user(login: $login) {
    __typename
    avatarUrl
    contributionsCollection(from: $from, to: $to) {
      __typename
      contributionCalendar {
        __typename
        weeks {
          __typename
          contributionDays {
            __typename
            date
            contributionCount
          }
        }
      }
    }
    bio
    followers {
      __typename
      totalCount
    }
    following {
      __typename
      totalCount
    }
    login
    name
    pullRequests {
      __typename
      totalCount
    }
    issues {
      __typename
      totalCount
    }
  }
}"
